import { useEffect, useState } from "react";

const Meow = () =>{
    const [showElement,setShowElement] = useState(true)
    useEffect(()=>{
      setTimeout(function() {
        setShowElement(false)
           }, 3000);
         },
     [])

    return(
      <div>
         {showElement ?
            <div className='Meow' 
                style={{
                    display: "block",
              }}>
                <p className="textMeow">Meow</p>
                <img src="/image/logo.svg" alt="Money Cat logo" className="logo"/> 
            </div> :
            <></>} 
      </div>
    )
  }

  export default Meow;
